  >
    <div style={{ width: "50%" }}>
      <div>
        <Title>Interested?</Title>
        <Paragraph style={{ fontSize: "18px" }}>
          Enter your email to recieve information as we release them ðŸ˜Š
        </Paragraph>
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "row"
        }}
      >
        <Input size="large" placeholder="Email" />
        <Button size="large" type="primary">
          Sign Up
        </Button>
      </div>
    </div>
  </div>
);
